import React from 'react';
import PropTypes from 'prop-types';
import Row from 'react-bootstrap/lib/Row';


const NavBar = ({ children }) => (
  <Row>
    {children}
  </Row>
);

NavBar.propTypes = {
  children: PropTypes.oneOfType([
    PropTypes.arrayOf(PropTypes.node),
    PropTypes.node,
  ]).isRequired,
};

export default NavBar;
